import React from "react";
import { NavLink } from "react-router-dom";

const Books = () => {
	return (
		<>
			<div className="container-fluid mt-5">
				<a class="mt-4 btn btn-primary" href="/addbook" role="button" on>
					Add Book
				</a>
			</div>
		</>
	);
};

export default Books;
